import React from 'react';
import Createuser from "./Components/Createuser/Createuser";
import Products from './Components/Products/Products'
import Login from "./Components/Createuser/Login";
import { Route, Switch } from 'react-router-dom';
import Slider from "./Components/Slider/Slider";
import Product_detail from './Components/Products/product_detail/product_detail';
function App() {


  const product_details = ({match})=>(
      console.log('match', match) ||
    <div>

        <product_detail id={match.params.name}/>

    </div>
  )








  return (

    <div>




    <Switch>
      <Route path="/Register" component={Createuser} />
      <Route path="/Login" component={Login} />
      <Route path="/slider" component={Slider}/>
      <Route path="/products/" component={Products}/>
      <Route path="/Product_detail/" component={Product_detail}/>


    </Switch>
    <Route path="/products/:name" component={product_details}/>


</div>
  );
}

export default App;
